import React from 'react';

const Rank = (users)=>{
    return(
        <div>
           <div className = 'f3'>
                {users.name}{', your current rank is .....'}
           </div>
           <div className = 'f1'>
                {users.entries}
           </div>
        </div>
    )
}

export default Rank;
